import React from 'react';
const Login =() =>{
 return(
    <div class ="my-5 inline-grid space-y-5 ">
        <h1 class='text-center font-bold '>Login  </h1>
        <input type='email' class=" form-input w-56 outline outline-offset-2 outline-1  rounded-md" placeholder='Enter your email' />
        <input type='password' class=" w-56 outline outline-offset-2 outline-1  rounded-md" placeholder='Enter your password' />
        <button class='outline-4 text-left' >Login</button>

    </div>
 )
}

export default Login;
